script: |
  super -f text -I q11123.spq | sort > q11123.out

inputs:
  - name: q11123.spq
    data: |
      SELECT DISTINCT - cor0.col0 * cor0.col0 AS col1 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab1
  - name: tab2

outputs:
  - name: q11123.out
    data: |
      -4096
      -6400
      -9
